INSERT INTO `set_pages` (`PageID`, `PageGUID`, `Title`, `Content`) VALUES
(1, 'about', 'About Fandom Royale', '&lt;p&gt;The creators of Fandom Royale have managed and/or participated in fantasy sports leagues for over two decades.&lt;/p&gt;\r\n\r\n&lt;p&gt;We are big believers in DFS being a game of skill, not a game of luck, thus why our public contest drafts&amp;nbsp;do not implement auto-drafting. We are excited to bring our contests and leagues to the public.&amp;nbsp;Our unique season-long private leagues implement a weekly draft system, so you never have to worry about being stuck with hurt or under-performing players, and it allows for the league to last until the conference championship of chosen sport. In our total point&amp;nbsp;contests you will jockey for position to be at the top of the leaderboard when the contest&amp;nbsp;conclude.&lt;/p&gt;\r\n\r\n&lt;p&gt;We look forward to serving your fantasy sports needs. As our customer you are the #1 ingredient to a successful website. Any questions or comments, please contact us at:&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n');
