(2, 'terms', 'Terms & Conditions', '&lt;p&gt;Fandom Royale&amp;nbsp;provides an interactive online service (the &amp;quot;Service&amp;quot; or &amp;ldquo;Company Service&amp;rdquo;) offered from time to time at&amp;nbsp;https://www.FandomRoyale.com.&amp;nbsp;The Service offers users access to (i) information, software and other content owned or licensed by&amp;nbsp;Company&amp;nbsp;and third-parties (&amp;quot;Content Providers&amp;quot;), and (ii) merchandise and services offered by independent merchants (&amp;quot;Merchants&amp;quot;) and&amp;nbsp;Company. (collectively, the &amp;ldquo;Site,&amp;rdquo; or &amp;ldquo;Sites&amp;rdquo;). The Company Service is owned and operated by Hypo iGames (&amp;ldquo;Company&amp;rdquo;, &amp;ldquo;we&amp;rdquo; or &amp;ldquo;us&amp;rdquo;).&lt;/p&gt;\r\n\r\n&lt;p&gt;Your use of the Company Service is subject to the terms and conditions set forth in these Terms of Service (the &amp;ldquo;Terms of Service&amp;rdquo;).&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;PLEASE READ THE TERMS OF SERVICE CAREFULLY. BY ACCESSING OR USING ANY PART OF THE COMPANY SERVICE, YOU ACKNOWLEDGE THAT YOU HAVE READ, UNDERSTAND AND AGREE TO BE BOUND BY ALL THE TERMS OF THE TERMS OF SERVICE. IF YOU DO NOT AGREE TO THESE TERMS OF SERVICE, EXIT THIS PAGE AND DO NOT ACCESS OR USE THE COMPANY SERVICE. USE OF THE COMPANY SERVICE IS EXPRESSLY CONDITIONED UPON YOUR ACCEPTANCE OF THE TERMS OF SERVICE.&lt;/p&gt;\r\n\r\n&lt;h4&gt;1. Updates&amp;nbsp;to Terms of Service; Integration.&lt;/h4&gt;\r\n\r\n&lt;p&gt;We may, in our sole discretion, modify the Terms of Service via email or by posting notice on any part of the Company Service. The &amp;ldquo;Last Updated&amp;rdquo; date at the top the Terms of Service indicates when the latest modifications were made to the Terms of Service. By continuing to access and use the Company Service you agree to any such modifications. Therefore, you are responsible for reviewing and should become familiar with any such modifications. You are encouraged to review this Terms of Service periodically and to check the &amp;ldquo;Last Updated&amp;rdquo; date at the top of the Terms of Service for the most recent version. In addition, when using services or features on the Company Service, you will be subject to any posted guidelines or policies applicable to such services or features that may be posted from time to time, including but not limited to the Privacy Policy as noted below. All such guidelines or policies are hereby incorporated by reference into these Terms of Service.&lt;/p&gt;\r\n\r\n&lt;h4&gt;2. Translation.&lt;/h4&gt;\r\n\r\n&lt;p&gt;We may translate these Terms of Service into other languages for your convenience. Nevertheless, the English version governs your relationship with Company, and any inconsistencies among the different versions will be resolved in favor of the English version.&lt;/p&gt;\r\n\r\n&lt;h4&gt;3. Service Availability.&lt;/h4&gt;\r\n\r\n&lt;p&gt;The Company Service may be modified, updated, interrupted, suspended or discontinued at any time without notice or liability. If the Company Service were discontinued at any time, all data would be deleted pursuant to the discontinuation process.&lt;/p&gt;\r\n\r\n&lt;h4&gt;4. Privacy Policy.&lt;/h4&gt;\r\n\r\n&lt;p&gt;Use of the Company Service is subject to the terms of our&amp;nbsp;Privacy Policy&amp;nbsp;which is hereby incorporated into and made part of these Terms of Service. Please carefully review our Privacy Policy. By using or accessing the Company Service, you agree to be bound by the terms of our Privacy Policy.&lt;/p&gt;\r\n\r\n&lt;h4&gt;5. Age.&lt;/h4&gt;\r\n\r\n&lt;p&gt;The Service is meant for those at least 18&amp;nbsp;years of age. Use of the Service by anyone under the age of 18 is a violation of the Terms of Service. You may not use the Service if you are a competitor of the Service, or if we have previously banned you from use of the Service or closed your account.&lt;/p&gt;\r\n\r\n&lt;h4&gt;6. Intellectual Property.&lt;/h4&gt;\r\n\r\n&lt;p&gt;You acknowledge that all materials on the Company Service, including, but not limited to, the Website design, Application design, graphics, text, sounds, pictures, and other files and the selection and arrangement thereof (collectively, &amp;ldquo;Materials&amp;rdquo;), are the property of Company and/or its licensors, and are subject to and protected by United States and Canada and international copyright and other intellectual property laws and rights. All rights to Materials not expressly granted in these Terms of Service are reserved to their respective copyright owners. Company authorizes you to view, download and/or print the Materials only for personal, non-commercial use, provided that you keep intact all copyright and other proprietary notices contained in the original Materials. Except as expressly authorized by the Terms of Service, you may not copy, reproduce, distribute, republish, download, perform, display, post, transmit, scrape, copy, exploit, create derivative works or otherwise use any of the Materials in any form or by any means, without the prior written authorization of Company or the respective copyright owner. In the absence of a written agreement, you may not modify or adapt the Materials in any way or otherwise use them for any public or commercial purposes. The trademarks, service marks, trade names, trade dress and logos (collectively, &amp;ldquo;Marks&amp;rdquo;) contained or described in the Company Service are the sole property of Company and/or its licensors and may not be copied, altered or otherwise used, in whole or in part, without the prior written authorization of Company and/or its licensors. Company reserves the right to enforce its intellectual property rights fully under the law.&lt;/p&gt;\r\n\r\n&lt;p&gt;Your use of the Company Service is solely and exclusively under the limited license granted herein and you will not obtain any ownership interest therein through the Terms of Service or otherwise. All trademarks, service marks, trade names, domain names, slogans, logos, and other indicia of origin that appear on or in connection with any aspect of the Company Service are either the property of Company, its affiliates or licensors. Company retains the right to rescind and terminate the limited license granted hereunder at any point, for any reason. All rights not expressly granted herein by Company to you are fully reserved by Company, its advertisers and licensors.&lt;/p&gt;\r\n\r\n&lt;p&gt;Some of the company and product names, logos, brands, and other trademarks featured or referred to within the Company Service may not be owned by us and are the property of their respective trademark holders. These trademark holders are not affiliated with, nor do they sponsor or endorse the Company Service.&lt;/p&gt;\r\n\r\n&lt;h4&gt;7. Third Party Sites &amp;amp; Services.&lt;/h4&gt;\r\n\r\n&lt;p&gt;Links provided via the Company Service to Third-Party websites and services are provided only as a convenience. If you use these links, you may leave the Company Service. Company does not control nor endorse any such Third-Party websites. You agree that the Company Parties, as defined below, will not be responsible or liable for any content, goods or services provided by such Third-Party websites or for your use or inability to use such Third-Party websites. You will use such links at your own risk.&lt;/p&gt;\r\n\r\n&lt;p&gt;You are advised that other websites on the Internet, including Third-Party websites linked from the Company Service, might contain material or information: that some people may find offensive or inappropriate; that is inaccurate, untrue, misleading or deceptive; or that is defamatory, libelous, infringing of others&amp;rsquo; rights or otherwise unlawful. Company expressly disclaims any responsibility for the content, legality, decency or accuracy of any information, and for any products and services, that appear on any Third-Party website or in advertisements or content that Third-Party websites may have in the Company Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;Your interactions with organizations and/or individuals and Third-Party companies found on or through the Company Service, including payment and delivery of goods or services, and any other terms, conditions, warranties or representations associated with such dealings, are solely between you and such organizations and/or individuals. You agree and acknowledge that Company shall not under any circumstances be liable for any damages of any kind arising out of, or in connection with, or relating to, the products and services of a Thirty-Party.&lt;/p&gt;\r\n\r\n&lt;h4&gt;8. Use of the Service.&lt;/h4&gt;\r\n\r\n&lt;p&gt;You may be required to establish an account to use the Company Service and/or take advantage of certain features. &amp;quot;Account Holder&amp;quot; hereinafter means any person who establishes an authorized account (&amp;quot;Account&amp;quot;) for access to and use of the Service. The right to use the Service is personal to the Account Holder and an Account Holder Account is not transferable.&lt;/p&gt;\r\n\r\n&lt;p&gt;8.1 The&amp;nbsp;Company&amp;nbsp;service is not available to individuals or entities that cannot represent and warrant the following.&amp;nbsp;Company&amp;nbsp;may require you to provide&amp;nbsp;Company&amp;nbsp;with proof that you are eligible to participate according to this Section 8 prior to receiving a prize.&lt;/p&gt;\r\n\r\n&lt;p&gt;You hereby represent and warrant that:&lt;/p&gt;\r\n\r\n&lt;p&gt;a) you are a natural person (corporate entities and similar organizations are not eligible to use the&amp;nbsp;Company&amp;nbsp;Service for any purpose) and are over the age of majority in your State, Province, or Territory of residence, and or are otherwise fully able and competent to enter into the terms, conditions, obligations, affirmations, representations and warranties set forth in the Agreement and to abide by and comply with the terms of the Agreement. In any case, you affirm that you are over the age of 18, as the&amp;nbsp;Company&amp;nbsp;Service is not intended for minors&amp;nbsp;under 18;&lt;/p&gt;\r\n\r\n&lt;p&gt;b) you are a citizen or lawful permanent resident of the United States of America or Canada and that you have an address in the United States of America or Canada, or you are a resident of another country where these types of skill games are legal;&lt;/p&gt;\r\n\r\n&lt;p&gt;c) if you are physically located in the United States of America or Canada, that you reside in a jurisdiction in which use of any&amp;nbsp;Company&amp;nbsp;Service is not prohibited by applicable law;&lt;/p&gt;\r\n\r\n&lt;p&gt;d) if you are using any&amp;nbsp;Company&amp;nbsp;Service in which there is an entry fee and a prize is awarded:&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp; &amp;nbsp; i) YOU ARE NOT A RESIDENT OF ANY of the following states/provinces: Alabama, Arizona, Connecticut, Delaware, Hawaii, Idaho, Illinois, Indiana, Iowa, Louisiana, Maine, Michigan, Mississippi, Missouri, Montana, Nevada, New Hampshire, New Jersey, New York, Ohio, Pennsylvania, Quebec, Tennessee, Texas, Vermont, Virginia, Washington.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp; &amp;nbsp; ii) you are not an amateur or professional athlete whose performance may be used to determine the outcome of a contest;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp; &amp;nbsp; iii) you are not a sports agent, team employee, referee, or league official associated with any sport or athletic event on which contests are based;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp; &amp;nbsp; iv) you are not an employee or family member or any employee of&amp;nbsp;Company;&lt;/p&gt;\r\n\r\n&lt;p&gt;e) you will abide at all times by the terms of the Agreement;&lt;/p&gt;\r\n\r\n&lt;p&gt;If you do not meet the eligibility requirements of this Section 8.1, then do not use the&amp;nbsp;Company&amp;nbsp;Service. In addition to any other rights that&amp;nbsp;Company&amp;nbsp;may have in law or equity,&amp;nbsp;Company&amp;nbsp;reserves the right to suspend or terminate the account (and terminate, withhold or revoke any prizes associated with such account) of any purported user of the&amp;nbsp;Company&amp;nbsp;Service that does not meet the foregoing requirements.&lt;/p&gt;\r\n\r\n&lt;p&gt;8.2 If you do meet these eligibility requirements, you agree to:&lt;/p&gt;\r\n\r\n&lt;p&gt;a. provide true, accurate, current and complete information about yourself as prompted by the Company Service;&lt;/p&gt;\r\n\r\n&lt;p&gt;b. as permitted, maintain and promptly update such information. If you provide any information that is false, inaccurate or outdated, or Company has reasonable grounds to suspect that such information is false, inaccurate or outdated, Company has the right to suspend or terminate your account and prohibit all current or future use of the Company Service by you; and&lt;/p&gt;\r\n\r\n&lt;p&gt;c. that your account is for your personal, non-commercial use only. By creating an account, you agree to receive certain communications in connection with the Company Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;d.not open more than one account per user or two accounts per computer/IP address.&lt;/p&gt;\r\n\r\n&lt;p&gt;8.3 You are responsible for maintaining the confidentiality of the password and account and are fully responsible for all activities that occur under your account. Your account is meant to be private and you shall not share accounts for any reason. You agree to immediately notify us of any unauthorized use of your password or account or any other breach of security. You agree to be responsible for all charges resulting from the use of your account via the Company Service, including charges resulting from unauthorized use of your account.&lt;/p&gt;\r\n\r\n&lt;p&gt;You are responsible for ensuring that all use of the Service under the Account Holder&amp;#39;s Account (i.e., use of the Service by any person using the Account Holder&amp;#39;s ID and password) complies with the provisions of this Agreement and all operating rules. Access to and use of premium features or options of the Service is subject to posted terms and conditions. Unauthorized access to the Service or any premium feature or option is a breach of this Agreement and a violation of law and will result in the automatic termination of this Agreement and the rights granted hereunder and other legal consequences. Account responsible for, and assume all liability associated with, any material made available via the Service under the Account Holder&amp;#39;s Account, including liability for claims of infringement, libel and slander.&lt;/p&gt;\r\n\r\n&lt;p&gt;8.4 You may not impersonate someone else (e.g., adopt the identity of a celebrity or your next-door neighbor), create or use an account for anyone other than yourself, provide an email address other than your own, or create multiple accounts. If you use a pseudonym, take care to note that others may still be able to identify you if, for example, you include identifying information in your reviews, use the same account information on other sites, or allow other sites to share information about you with the Company Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;8.5 You agree to use the Company Service only for lawful purposes and that you are responsible for your use of and communications and content you may post via the Company Service. You agree not to post or transmit any unlawful, infringing, threatening, harassing, defamatory, vulgar, obscene, profane, indecent, offensive, hateful or otherwise objectionable material of any kind, including any material that encourages criminal conduct or conduct that would give rise to civil liability, infringes upon others&amp;rsquo; intellectual property rights, impersonates any individual or entity, or otherwise violates any applicable law. You agree not to solicit personal information from minors. You agree not to use the Company Service in any manner that interferes with its normal operation or with any other user&amp;rsquo;s use of the Company Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;8.6 You may not do any of the following while accessing or using the Company Service:&lt;/p&gt;\r\n\r\n&lt;p&gt;a. access, tamper with, or use non-public areas of the Company Service, our computer systems, or the technical delivery systems of our providers;&lt;/p&gt;\r\n\r\n&lt;p&gt;b. probe, scan, or test the vulnerability of any system or network or breach or circumvent any security or authentication measures;&lt;/p&gt;\r\n\r\n&lt;p&gt;c. access or search or attempt to access or search the Company Service by any means other than through our currently available, published interfaces that are provided by us, unless you have been specifically allowed to do so in a separate agreement with us;&lt;/p&gt;\r\n\r\n&lt;p&gt;d. forge any TCP/IP packet header or any part of the header information in any email or posting, or in any way use the Company Service to send altered, deceptive or false source-identifying information; or&lt;/p&gt;\r\n\r\n&lt;p&gt;e. disrupt or interfere with the access of any user, host or network, including, without limitation, sending a virus, overloading, flooding, spamming, mail-bombing the Company Service, or otherwise creating an undue burden on the Company Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;f.manipulate, abuse, or display behavior that may be interpreted as the use of unfair methods with respect to any Fee Tournament or the&amp;nbsp;Company&amp;nbsp;Service in any way, including, but not limited to, the opening and/or use of multiple accounts, the use of unauthorized or altered software or hardware to assist play, intentionally poor play in certain games in order to achieve a broader competitive advantage (i.e. &amp;quot;sandbagging&amp;quot;) or deliberately transfer money between accounts (i.e. &amp;quot;money laundering&amp;quot;).&lt;/p&gt;\r\n\r\n&lt;p&gt;g.use manual or automated software, devices, or other processes to &amp;ldquo;crawl,&amp;rdquo; &amp;ldquo;scrape,&amp;rdquo; or &amp;ldquo;spider&amp;rdquo; any page of the Company Service. You will not decompile, reverse engineer, or otherwise attempt to obtain the source code of any part of the Company Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;8.7 You further agree that you will not access the Company Service by any means except through the interface provided by Company for access to the Company Service. Creating or maintaining any link from another application to any page at the Company Service without the prior authorization of Company is prohibited. Running or displaying the Company Service, or any information or material displayed via the Company Service in frames or through similar means on another website or application without the prior authorization of Company is prohibited. Any permitted links to the Company Service must comply with all applicable laws, rule and regulations.&lt;/p&gt;\r\n\r\n&lt;p&gt;8.8 Company makes no representation that Materials contained, described or offered via the Company Service are accurate, appropriate or available for use in jurisdictions outside the United States and Canada, or that these Terms of Service comply with the laws of any other country. Visitors who use the Company Service and reside outside the United States and Canada do so on their own initiative and are responsible for compliance with all applicable law. You agree that you will not access the Company Service from any territory where its contents are illegal, and that you, and not the Company Parties, are responsible for compliance with applicable law.&lt;/p&gt;\r\n\r\n&lt;p&gt;8.9 Your use of the Company Service is at your own risk, including the risk that you might be exposed to Content that is offensive, indecent, inaccurate, objectionable, or otherwise inappropriate.&lt;/p&gt;\r\n\r\n&lt;p&gt;8.10 Furthermore, you herein agree not to make use of the Services for:&lt;/p&gt;\r\n\r\n&lt;p&gt;a. uploading, posting, emailing, transmitting, or otherwise making available any content that shall be deemed unlawful, harmful, threatening, abusive, harassing, tortious, vulgar, obscene, libelous, or invasive of another&amp;#39;s privacy or which is hateful, and/or racially, ethnically, or otherwise objectionable;&lt;/p&gt;\r\n\r\n&lt;p&gt;b. causing harm to minors in any manner whatsoever;&lt;/p&gt;\r\n\r\n&lt;p&gt;c. impersonating any individual or entity, including, but not limited to, any Company, forum leaders, guides or hosts or falsely stating or otherwise misrepresenting any affiliation with an individual or entity;&lt;/p&gt;\r\n\r\n&lt;p&gt;d. forging captions, headings or titles or otherwise offering any content that you personally have no right to pursuant to any law nor having any contractual or fiduciary relationship with;&lt;/p&gt;\r\n\r\n&lt;p&gt;e. uploading, posting, emailing, transmitting or otherwise offering any such content that may infringe upon any patent, copyright, trademark, or any other proprietary or intellectual rights of any other party;&lt;/p&gt;\r\n\r\n&lt;p&gt;f. uploading, posting, emailing, transmitting or otherwise offering any content that you do not personally have any right to offer pursuant to any law or in accordance with any contractual or fiduciary relationship;&lt;/p&gt;\r\n\r\n&lt;p&gt;g. uploading, posting, emailing, transmitting, or otherwise offering any unsolicited or unauthorized advertising, promotional flyers, &amp;quot;junk mail,&amp;quot; &amp;quot;spam,&amp;quot; or any other form of solicitation, except in any such areas that may have been designated for such purpose;&lt;/p&gt;\r\n\r\n&lt;p&gt;h. uploading, posting, emailing, transmitting, or otherwise offering any source that may contain a software virus or other computer code, any files and/or programs which have been designed to interfere, destroy and/or limit the operation of any computer software, hardware, or telecommunication equipment;&lt;/p&gt;\r\n\r\n&lt;p&gt;i. disrupting the normal flow of communication, or otherwise acting in any manner that would negatively affect other users&amp;#39; ability to participate in any real-time interactions;&lt;/p&gt;\r\n\r\n&lt;p&gt;j. interfering with or disrupting any of the Services, servers and/or networks that may be connected or related to our website, including, but not limited to, the use of any software and/or routine to bypass the robot exclusion headers;&lt;/p&gt;\r\n\r\n&lt;p&gt;k. intentionally or unintentionally violating any local, state, federal, national or international law, including, but not limited to, rules, guidelines, and/or regulations decreed by the Securities and Exchange Commission, in addition to any rules of any nation or other securities exchange, that would include without limitation, the New York Stock Exchange, the American Stock Exchange, or the NASDAQ, and any regulations having the force of law;&lt;/p&gt;\r\n\r\n&lt;p&gt;l. providing informational support or resources, concealing and/or disguising the character, location, and or source to any organization delegated by the United States government as a &amp;quot;foreign terrorist organization&amp;quot; in accordance to Section 219 of the Nationality Act;&lt;/p&gt;\r\n\r\n&lt;p&gt;m. stalking or with the intent to otherwise harass another individual; and/or,&lt;/p&gt;\r\n\r\n&lt;p&gt;n. collecting or storing of any personal data relating to any other user in connection with the prohibited conduct and/or activities which have been set forth in the aforementioned paragraphs.&lt;/p&gt;\r\n\r\n&lt;p&gt;o.taking any action that may undermine any Fee Tournament, content rating or comment systems (such as displaying, importing or exporting information off the&amp;nbsp;Company&amp;nbsp;Service, using information on the&amp;nbsp;Company&amp;nbsp;Service for purposes unrelated to the&amp;nbsp;Company&amp;nbsp;Service, or improperly manipulating or using the Tournaments, ratings and comment systems).&lt;/p&gt;\r\n\r\n&lt;h4&gt;9. Suggestions and Improvements.&lt;/h4&gt;\r\n\r\n&lt;p&gt;By sending us any ideas, suggestions, documents or proposals (&amp;ldquo;Feedback&amp;rdquo;), you agree that (i) your Feedback does not contain the confidential or proprietary information of third parties, (ii) we are under no obligation of confidentiality, express or implied, with respect to the Feedback, (iii) we may have something similar to the Feedback already under consideration or in development, and (iv) you grant us an irrevocable, non-exclusive, royalty-free, perpetual, worldwide license to use, modify, prepare derivative works, publish, distribute and sublicense the Feedback, and you irrevocably waive, and cause to be waived, against Company and its users any claims and assertions of any moral rights contained in such Feedback.&lt;/p&gt;\r\n\r\n&lt;h4&gt;10. Content.&lt;/h4&gt;\r\n\r\n&lt;p&gt;10.1 You shall retain all of your ownership rights in your User Submissions. However, by submitting User Submissions to&amp;nbsp;Company, you hereby grant&amp;nbsp;Company&amp;nbsp;and its affiliates a worldwide, non-exclusive, fully paid-up, royalty-free, perpetual, irrevocable, sublicenseable, and transferable license to use, reproduce, distribute, modify, adapt, prepare derivative works of, display, perform, and otherwise exploit your User Submissions in connection with the&amp;nbsp;Company&amp;nbsp;Service and&amp;nbsp;Company&amp;#39;s (and its successor&amp;#39;s) business, including without limitation for promoting and redistributing part or all of the&amp;nbsp;Company&amp;nbsp;Service (and derivative works thereof) in any media formats and through any media channels now known or hereafter discovered. You grant&amp;nbsp;Company&amp;nbsp;and its affiliates and sublicensees the right to use the name and/or likeness that you submit in connection with such User Submission if they choose. You also agree to irrevocably waive (and cause to be waived) any claims and assertions of moral rights or attribution with respect to your User Submissions. You also hereby grant to each user of the&amp;nbsp;Company&amp;nbsp;Service a non-exclusive license to access your User Submissions through the&amp;nbsp;Company&amp;nbsp;Service, and to use, reproduce, distribute, prepare derivative works of, display, and perform such User Submissions as permitted by the functionality of the&amp;nbsp;Company&amp;nbsp;Service and this Agreement. By accepting any prize from&amp;nbsp;Company, you hereby grant&amp;nbsp;Company&amp;nbsp;a nonexclusive, perpetual license to print, publish, broadcast and use, worldwide, in any media and at any time, your name, picture, voice, likeness, and/or biographical information for promotional or related purposes without any additional compensation. User Submissions may be copied, published, distributed or otherwise used by&amp;nbsp;Company&amp;nbsp;for any purpose without your permission.&lt;/p&gt;\r\n\r\n&lt;p&gt;10.2 User Submissions Representations and Warranties&lt;/p&gt;\r\n\r\n&lt;p&gt;You shall be solely responsible for your own User Submissions and the consequences of posting or publishing them. In connection with User Submissions, you affirm, represent, and/or warrant that: (i) you own, or have the necessary licenses, rights, consents, and permissions to use and authorize&amp;nbsp;Company&amp;nbsp;to use all patent, trademark, copyright, or other proprietary rights in and to any and all User Submissions to enable inclusion and use of User Submissions in the manner contemplated by&amp;nbsp;Company&amp;nbsp;and this Agreement, and to grant the rights and license set forth above, and (ii) your User Submissions,&amp;nbsp;Company&amp;#39;s use of such User Submissions pursuant to these Terms of Use, and&amp;nbsp;Company&amp;#39;s exercise of the license rights set forth above, do not and will not: (a) infringe, violate, or misappropriate any third-party right, including any copyright, trademark, patent, trade secret, moral right, privacy right, right of publicity, or any other intellectual property or proprietary right; (b) slander, defame, libel, or invade the right of privacy, publicity or other property rights of any other person; or (c) violate any applicable law or regulation.&lt;/p&gt;\r\n\r\n&lt;p&gt;10.3 User Submissions Prohibited Uses&lt;/p&gt;\r\n\r\n&lt;p&gt;In connection with your User Submissions, you further agree that you will not publish, post, submit, transmit through or otherwise make available via the Service: (i) any material which violates or infringes in any way upon the rights of others, which is unlawful, defamatory, libelous, slanderous, pornographic, obscene, abusive, profane, vulgar, sexually explicit, racist, threatening, harassing, harmful, hateful, racially or ethnically offensive, or otherwise objectionable or which encourages conduct that would constitute a criminal offense, give rise to civil liability or otherwise violate any law or any right of privacy or publicity, or is otherwise inappropriate; (ii) without the express written consent of the owner thereof, any copyrighted material: (iii) without the express prior written consent of&amp;nbsp;Company, any advertising or any solicitation with respect to any business, products or services; or (iv) User Submissions that would be harmful to minors in any manner.&lt;/p&gt;\r\n\r\n&lt;p&gt;10.4 Content Disclaimer&lt;/p&gt;\r\n\r\n&lt;p&gt;You understand that when using the&amp;nbsp;Company&amp;nbsp;Service, you will be exposed to User Submissions and other content from a variety of sources (&amp;quot;Third-Party Content&amp;quot;), and that&amp;nbsp;Company&amp;nbsp;shall not be responsible for any opinions, views, advice or statements posted on the Service (including, without limitation, in any public posting areas of the Service) by any person or entity other than an authorized&amp;nbsp;Company&amp;nbsp;spokesperson. Service advertisers, Content Providers, Account Holder, guests, independent writers and experts are not authorized&amp;nbsp;Company&amp;nbsp;spokespersons. At no time should the opinions, views, advice or statements provided by Service advertisers, Content Providers, Account Holder, guests, independent writers or experts be relied upon for important personal decisions without independent verification.&lt;/p&gt;\r\n\r\n&lt;p&gt;Company&amp;nbsp;is not responsible for the accuracy, integrity, quality, legality, usefulness, safety, or intellectual property rights of or relating to such Third-Party Content. You further understand and acknowledge that you may be exposed to Third-Party Content that is inaccurate, offensive, indecent, or objectionable, and you agree to waive, and hereby do waive, any legal or equitable rights or remedies you have or may have against&amp;nbsp;Company&amp;nbsp;with respect thereto.&amp;nbsp;Company&amp;nbsp;does not endorse any User Submission or other Third-Party Content or any opinion, recommendation, or advice expressed therein. Under no circumstances will&amp;nbsp;Company&amp;nbsp;be liable in any way for or in connection with any User Submissions or other Third-Party Content, including, but not limited to, for any inaccuracies, errors or omissions in any Third-Party Content, any intellectual property infringement with regard to any Third-Party Content, or for any loss or damage of any kind incurred as a result of the use of any Third-Party Content posted, emailed or otherwise displayed or transmitted via the&amp;nbsp;Company&amp;nbsp;Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;10.5 Monitoring Users and Content.&lt;/p&gt;\r\n\r\n&lt;p&gt;You understand that all Third-Party Content is the sole responsibility of the person from whom such Third-Party Content originated. This means that you, and not&amp;nbsp;Company, are entirely responsible for all User Submissions that you upload, post, e-mail, transmit or otherwise make available through via the&amp;nbsp;Company&amp;nbsp;Service.&amp;nbsp;Company&amp;nbsp;does not control the Third-Party Content posted by users or otherwise made available by other persons and does not have any obligation to monitor such Third-Party Content for any purpose. If at any time,&amp;nbsp;Company&amp;nbsp;chooses, in its sole discretion, to monitor the Third-Party Content,&amp;nbsp;Company&amp;nbsp;nonetheless assumes no responsibility for the Third-Party Content, no obligation to modify or remove any inappropriate Third-Party Content, and no responsibility for the conduct of the person submitting any such Third-Party Content. You acknowledge that&amp;nbsp;Company&amp;nbsp;may or may not pre-screen User Submissions, but that&amp;nbsp;Company&amp;nbsp;and its designees shall have the right (but not the obligation) in their sole discretion to pre-screen, refuse, or remove any User Submission that is available via the&amp;nbsp;Company&amp;nbsp;Service. Without limiting the foregoing,&amp;nbsp;Company&amp;nbsp;and its designees may, at any time and without prior notice, remove any User Submission that in the sole judgment of&amp;nbsp;Company&amp;nbsp;violates this Agreement or is otherwise objectionable. You agree that you must evaluate, and bear all risks associated with the use of any User Submissions or other Third-Party Content, including any reliance on the accuracy, completeness, usefulness or legality of such User Submission or other Third-Party Content.&lt;/p&gt;\r\n\r\n&lt;p&gt;10.6 Removal of Content&lt;/p&gt;\r\n\r\n&lt;p&gt;Company&amp;nbsp;and its designees shall have the right (but not the obligation) in their sole discretion to refuse or remove any Third-Party Content that is available on the&amp;nbsp;Company&amp;nbsp;Service in whole or in part at any time for any reason or no reason, with or without notice and with no liability of any kind. Although&amp;nbsp;Company&amp;nbsp;does not and cannot review all Third-Party Content,&amp;nbsp;Company&amp;nbsp;shall be under no obligation to permit any material posted to remain on the Service and may refuse to display or remove from the Service for any reason or no reason at all. You acknowledge that any User Submissions may be edited, removed, modified, published, transmitted and displayed by&amp;nbsp;Company&amp;nbsp;in its sole and absolute discretion.&lt;/p&gt;\r\n\r\n&lt;p&gt;10.7 User Disagreements.&lt;/p&gt;\r\n\r\n&lt;p&gt;You are solely responsible for your involvement with other users of the Company Service. If you have a dispute with one or more users, you release Company (and Company&amp;#39;s officers, directors, agents, subsidiaries, joint ventures and employees) from claims, demands and damages (actual and consequential) of every kind and nature, known and unknown, arising out of or in any way connected with such disputes. If you are a California resident, you waive California Civil Code Section 1542, which says: &amp;quot;A general release does not extend to claims which the creditor does not know or suspect to exist in his favor at the time of executing the release, which if known by him must have materially affected his settlement with the debtor.&amp;quot;&lt;/p&gt;\r\n\r\n&lt;h4&gt;11. Termination.&lt;/h4&gt;\r\n\r\n&lt;p&gt;You may terminate your use of the Company Service at any time. You agree that Company may terminate or suspend your access to all or part of the Company Service, with or without notice, in our reasonable discretion, at any time. Company reserves the right to modify or discontinue the Company Service (or any part thereof) with or without notice, at any time. Following the termination or cancellation of your subscription to the Company Service and/or your account, we reserve the right to delete all your data in the normal course of operations.&lt;/p&gt;\r\n\r\n&lt;h4&gt;12. Fees, Deposits and Withdrawals&lt;/h4&gt;\r\n\r\n&lt;p&gt;12.1 Price and Payment&lt;/p&gt;\r\n\r\n&lt;p&gt;Company may offer Premium Content, Subscriptions and Pay Leagues on a chargeable basis. Account Holders must provide&amp;nbsp;Company&amp;nbsp;with valid credit card information at the time of purchase or use their PayPal account. All fees will be charged at the standard fees in effect for that Premium Content, Subscription, or Pay Leagues at the time the fee becomes payable. Company will not automatically renew Premium Content, Subscription, or Pay League purchases. The Account Holder will be responsible for all charges incurred through use of the Account, including but not limited to charges incurred by any Immediate Family Member of the Account Holder.&lt;/p&gt;\r\n\r\n&lt;p&gt;12.2 Deposits and Withdrawals&lt;/p&gt;\r\n\r\n&lt;p&gt;If a deposit is made and part or all or that amount is requested to be refunded, the funds can only be refunded back using the original method of payment for the deposit. This does not include prize winnings, which can be withdrawn via any of the available methods regardless of the deposit method. For example, if funds are deposited to your Company account via credit or debit card, they may not be refunded to a PayPal account. If funds are deposited from a PayPal account, they may not be refunded to a credit or debit card.&lt;/p&gt;\r\n\r\n&lt;h4&gt;13.Representations.&lt;/h4&gt;\r\n\r\n&lt;p&gt;You expressly represent, warrant, and/or acknowledge that:&lt;/p&gt;\r\n\r\n&lt;p&gt;13.1 Company does not warrant or guarantee the suitability or availability of any Material or Content, including without limitation any, data, products or services, found through the Company Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;13.2 Company does not screen the authenticity or quality of any Material or Content or any provider of Material or Content, including, data, products or services found through the Company Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;13.3 Company makes no representations or promises regarding any Material or Content, and that many of the Material or Content provided via the Company Service may be owned or licensed by third parties.&lt;/p&gt;\r\n\r\n&lt;p&gt;13.4 You are of legal age to form a binding contract and are at least eighteen (18) years of age or you have the authority of such legal entity to form a binding contract; all registration information you submit is accurate and truthful; you will maintain the accuracy of such information; and you are legally permitted to use and access the Company Service and take full responsibility for the selection and use of and access to the Company Service.&lt;/p&gt;\r\n\r\n&lt;h4&gt;14. Digital Millennium Copyright Act Compliance.&lt;/h4&gt;\r\n\r\n&lt;p&gt;14.1 It is&amp;nbsp;Company&amp;#39;s policy to respond to notices of alleged copyright infringement that comply with the Digital Millennium Copyright Act (&amp;quot;DMCA&amp;quot;).&amp;nbsp;Company&amp;nbsp;will promptly terminate without notice any User&amp;#39;s access to the&amp;nbsp;Company&amp;nbsp;Service if that User is determined by&amp;nbsp;Company&amp;nbsp;to be a &amp;quot;repeat infringer.&amp;quot; A repeat infringer is a User who has been notified by&amp;nbsp;Company&amp;nbsp;of infringing activity violations more than twice and/or who has had a User Submission or any other user-submitted content removed from the&amp;nbsp;Company&amp;nbsp;Service more than twice.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;14.2 Procedure for Notifying the Company of Copyright Infringement&lt;/strong&gt;.&lt;/p&gt;\r\n\r\n&lt;p&gt;Those who believe that their copyrighted work has been infringed or are aware of other infringing material, should contact our Copyright Agent at the address listed below and provide us with the following information:&lt;/p&gt;\r\n\r\n&lt;p&gt;a. An electronic or physical signature of a person authorized to act on behalf of the owner of the copyrighted work that has allegedly been infringed.&lt;/p&gt;\r\n\r\n&lt;p&gt;b. Identification of the copyrighted work claimed to have been infringed.&lt;/p&gt;\r\n\r\n&lt;p&gt;c. Information describing where the allegedly infringing material is located on the Company Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;d. Your address, telephone number, and email address.&lt;/p&gt;\r\n\r\n&lt;p&gt;e. A written statement by you that you have a good faith belief that the disputed use is not authorized by the copyright owner, its agent, or the law.&lt;/p&gt;\r\n\r\n&lt;p&gt;f. A statement by you that the above information in your notification is accurate and that, under penalty of perjury, you are the copyright owner or authorized to act on the copyright owner&amp;rsquo;s behalf. The foregoing information may be emailed or mailed to our Copyright Agent at the addresses listed at the end of this Terms of Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;Following receipt of the information listed above, we will remove or disable access to the infringing material and take reasonable steps to notify the user responsible for posting said material. The posting of infringing copyrighted material may result in the termination of user privileges of such user.&lt;/p&gt;\r\n\r\n&lt;p&gt;If you believe that your copyright has been infringed on the&amp;nbsp;Company&amp;nbsp;Service, please send a &amp;quot;DMCA&amp;quot; compliant notice to &lt;strong&gt;FR.support@Hypo-iGames.com&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;h4&gt;15. Warranties, Disclaimers and Limitations of Liability.&lt;/h4&gt;\r\n\r\n&lt;p&gt;You expressly understand and agree that:&lt;/p&gt;\r\n\r\n&lt;p&gt;Your use of the company service is at your sole risk. the company service and the associated materials and content are provided on an &amp;ldquo;as is&amp;rdquo; and &amp;ldquo;as available&amp;rdquo; basis. except as otherwise expressly provided in these terms of service, company, its parent, subsidiary and other affiliated companies, and their respective officers, directors, employees, agents and other representatives (collectively, the &amp;ldquo;company parties&amp;rdquo;), expressly disclaim all warranties of any kind, whether express or implied, including, but not limited to the implied warranties of merchantability, fitness for a purpose and non-infringement. without limiting the generality of the foregoing, the company parties make no warranty that: (i) the company service will meet your requirements; (ii) the company service will be uninterrupted, timely, secure, or error-free; (iii) information that may be obtained via the company service will be accurate or reliable; (iv) the quality of any and all products, services, information or other material, including all merchandise, goods and services, obtained or purchased by you directly or indirectly through the company service will meet your expectations or needs; and (v) any errors in the company service will be corrected.&lt;/p&gt;\r\n\r\n&lt;p&gt;The company parties shall not under any circumstances be liable for any damages of any kind arising out of, in connection with or relating to the use of or inability to use the company service, including any liability: (i) as a publisher of information; (ii) for any incorrect or inaccurate information or any &amp;lsquo;bug&amp;rsquo; of the company service; (iii) for any unauthorized access to or disclosure of your transmissions or data; (iv) for statements or conduct of any third party on or via the company service; (v) for any disputes between users of the company service or between a user of the company service and a third party; or (vi) for any other matter relating to the company service or any third party. this is a comprehensive limitation of liability that applies to all damages of any kind, including any direct, indirect, special, incidental or consequential damages, whether based on breach of contract, breach of warranty, tort (including negligence), product liability or otherwise, even if an individual advises the company parties of the possibility of such damages. the limitations of liability set forth herein are fundamental elements of the basis of the bargain between company and you. the products, information and services offered on and through the company service would not be provided to you without such limitations.&lt;/p&gt;\r\n\r\n&lt;p&gt;Notwithstanding the foregoing, the sole and entire maximum liability of the company parties for any reason, and your sole and exclusive remedy for any cause or claim whatsoever, shall be limited to the charges paid by you directly to company via the company service for services provided solely and directly by company to you in the six months prior to such cause or claim.&lt;/p&gt;\r\n\r\n&lt;p&gt;Some jurisdictions do not allow the disclaimer of certain warranties or the limitation or exclusion of liability for certain types of damages. accordingly, some of the above disclaimers and limitations may not apply to you.&lt;/p&gt;\r\n\r\n&lt;p&gt;If you are a california resident, you shall and hereby do waive california civil code section 1542, which says: &amp;ldquo;a general release does not extend to claims which the creditor does not know or suspect to exist in his favor at the time of executing the release, which, if known by him must have materially affected his settlement with the debtor.&amp;rdquo;&lt;/p&gt;\r\n\r\n&lt;h4&gt;16. Indemnification.&lt;/h4&gt;\r\n\r\n&lt;p&gt;You agree to indemnify, defend and hold harmless the Company Parties against all claims, demands, causes of action, losses, expenses, damages and costs (including any reasonable attorneys&amp;rsquo; fees), resulting or arising from or relating to your use of the Company Service, any activity related to your account by you or any other person permitted by you, any Content that you submit to, post on or transmit through the Company Service, your breach of these Terms of Service, your infringement or violation of any rights of another, or termination of your access to the Company Service. We reserve the right to assume, at our sole expense, the exclusive defense and control of any such claim or action and all negotiations for settlement or compromise, and you agree to fully cooperate with us in the defense of any such claim, action, settlement or compromise negotiations, as requested by us.&lt;/p&gt;\r\n\r\n&lt;h4&gt;17. Notice to California Users.&lt;/h4&gt;\r\n\r\n&lt;p&gt;As required by California Code Section 1789.3, this notice is to advise you of the following:&amp;nbsp;FandomRoyale.com&amp;nbsp;is a service provided by Hypo iGames, LLC. b. The fees and charges for the Service vary depending on the premium features and tournaments selected by the Account Holder.&amp;nbsp;Company&amp;nbsp;reserves the right to change the amount of any fee or charge and to institute new fees or charges at any time. c. If you have a complaint regarding the Service or desire further information on use of the Service, contact Hypo iGames at &lt;strong&gt;FR.support@Hypo-iGames.com&lt;/strong&gt;&amp;nbsp;.&amp;nbsp; For complaints, you may also contact the Complaint Assistance Unit of the Division of Consumer Services of the Department of Consumer Affairs in writing at 400 &amp;quot;R&amp;quot; Street, Sacramento, California 95814 or by telephone at 1-916-445-1254.&lt;/p&gt;\r\n\r\n&lt;h4&gt;18. Miscellaneous.&lt;/h4&gt;\r\n\r\n&lt;p&gt;These Terms of Service constitute the entire agreement between Company and each user of the Company Service with respect to the subject matter of these Terms of Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;a) Entire Agreement; Modification. This Agreement sets forth the entire agreement and understanding of the parties hereto concerning the subject matter hereof. No modification hereof shall be binding upon the parties hereto except by written instrument.&lt;/p&gt;\r\n\r\n&lt;p&gt;b)Invalidity of Particular Provisions. If any term or provision of this Agreement or the application thereof to any person or circumstance shall to any extent be invalid or unenforceable, the other terms of this Agreement, or the application of such terms or provisions to persons or circumstances other than those as to which it is held invalid or unenforceable, shall not be affected thereby, and each term and provision of this Agreement shall be valid and be enforced to the fullest extent permitted by law.&lt;/p&gt;\r\n\r\n&lt;p&gt;c) The failure of the Company to insist upon strict adherence to any term of these Terms of Service shall not constitute a waiver of such term and shall not be considered a waiver or limit that party&amp;rsquo;s right thereafter to insist upon strict adherence to that term or any other term contained in these Terms of Service. You may not assign your obligations or rights hereunder to another entity or individual. We may transfer, assign or delegate these Terms of Service and its rights and obligations without your consent.&lt;/p&gt;\r\n\r\n&lt;p&gt;d) The terms of this Agreement, and any rights and licenses granted hereunder, may not be transferred or assigned by you, but may be assigned by&amp;nbsp;Company&amp;nbsp;without restriction. Any assignment attempted to be made in violation of this Agreement shall be void.&lt;/p&gt;\r\n\r\n&lt;p&gt;e) We shall have no liability to you hereunder if we are prevented from or delayed in performing our obligations, or from carrying on our business, by acts, events, omissions or accidents beyond our reasonable control, including, without limitation, strikes, lock-outs or other industrial disputes (whether involving the workforce of us or any other party), failure of a utility service or transport or telecommunications network, act of God, war, riot, civil commotion, malicious damage, compliance with any law or governmental order, rule, regulation or direction, accident, breakdown of plant or machinery, fire, flood or storm.&lt;/p&gt;\r\n\r\n&lt;p&gt;f) No agency, partnership, joint venture, or employment is created as a result of these Terms of Service and you do not have any authority of any kind to bind us in any respect whatsoever.&lt;/p&gt;\r\n\r\n&lt;p&gt;g) No action arising out of these Terms of Service or your use of the Company Service, regardless of form or the basis of the claim, may be brought by you more than one (1) year after the cause of action has arisen (or if multiple causes, from the date the first such cause arose).&lt;/p&gt;\r\n\r\n&lt;h4&gt;19. Applicable Law and Jurisdiction.&lt;/h4&gt;\r\n\r\n&lt;p&gt;Your use of the Company Service is governed by and will be enforced under the laws of the State of New York without regard to its conflict of law provisions. You agree to submit to the personal and exclusive jurisdiction of the courts located within the jurisdiction noted above. You agree that printed copies of any and all agreements and/or notices in electronic form are admissible in any legal or regulatory proceedings. Any controversy, claim, suit, injury or damage arising from or in any way related to the Company Service or these Terms of Service shall be settled by binding arbitration in accordance with the commercial arbitration rules of the American Arbitration Association then in effect and before a single arbitrator chosen by Company. Any such controversy, claim, suit, injury or damage shall be arbitrated on an individual basis and shall not be consolidated in any arbitration with any controversy, claim, suit, injury or damage of any other party. Company may seek any interim or preliminary relief from a court of competent jurisdiction in the State listed above necessary to protect its rights pending the completion of arbitration. Each party shall assume its own costs of arbitration. IN ANY CLAIM, ACTION OR PROCEEDING TO ENFORCE ANY RIGHT OR OBLIGATION OF THE PARTIES UNDER THE TERMS OF SERVICE INCLUDING, WITHOUT LIMITATION, RELATING TO YOUR USE OF THE COMPANY SERVICE, YOU HEREBY WAIVE ANY RIGHT YOU MAY NOW HAVE OR HEREAFTER POSSESS TO A TRIAL BY JURY.&lt;/p&gt;\r\n\r\n&lt;h4&gt;20. Customer Service.&lt;/h4&gt;\r\n\r\n&lt;p&gt;If you have any comments or questions regarding these Terms of Service or wish to report any violation of these Terms of Service, you may contact us at the addresses below.&lt;/p&gt;\r\n\r\n&lt;p&gt;Email Address:&lt;br /&gt;\r\n&lt;strong&gt;FR.support@Hypo-iGames.com&lt;/strong&gt;&lt;/p&gt;\r\n');
