(3, 'privacy', 'PRIVACY POLICY', '&lt;p&gt;Privacy policy forms part of our Website&amp;#39;s Terms of Service, by accepting the Terms of Service on the registration page, you consent to provide sensitive personal data or personal information and are aware of the purpose of sharing such information. Registration procedure cannot be completed until information in the non-optional fields is provided. Certain additional personal information may be requested by Fandom Royale for permitting you access to any Cash Games organized by.&lt;/p&gt;\r\n\r\n&lt;p&gt;Fandom Royale values the trust our users and customers place in us when they give us access to their Personal Information. The Privacy Policy describes how we work to maintain that trust and protect that information.&lt;/p&gt;\r\n\r\n&lt;p&gt;Fandom Royale has created this Privacy Policy in order to describe its collection, use and disclosure of personal data you give to Fandom Royale when you access or use Fandom Royale online and/or mobile services and websites.&lt;/p&gt;\r\n\r\n&lt;p&gt;This Privacy Policy covers only data that we collect through the Site, and not any other data collection or processing, including, without limitation, the data collection practices of any affiliate or other third party, including any third-party operators of web pages to which the Site links, and any information that we collect offline or through any websites, products, or services that do not display a direct link to this Privacy Policy.&lt;/p&gt;\r\n\r\n&lt;p&gt;Fandom Royale may amend this Privacy Policy at any time. By using the Site or providing information to us following such changes, you will have accepted the amended Privacy Policy. Fandom Royale will notify users via email and/or by posting a notice on Fandom Royale Site for 30 days prior to such use or by other means as required by law. Your Usage of website after posting notice shall&amp;hellip;&amp;hellip;&amp;hellip;..&lt;/p&gt;\r\n\r\n&lt;h4&gt;1. Information Collected&lt;/h4&gt;\r\n\r\n&lt;p&gt;When you create an Fandom Royale account, request information, subscribe for a service, participate in a game,&amp;nbsp;post a rating or review, post a question or answer, upload content or otherwise actively send us data on our Site, we collect such data including, but not limited to, your user name, password, first and last name, email address, telephone number (including mobile phone number), street address, gender, occupation, interests, messages you send to users, and any other data included in a submitted profile or resume, including but not limited to application materials and answers to screener questions submitted to Users through Fandom Royale. we will also collect payment information (e.g., credit card number and related verification information).&lt;/p&gt;\r\n\r\n&lt;p&gt;In addition, as part of the standard operation of the Site, Fandom Royale may automatically collect and analyze information from your computer or mobile device, including, but not limited to, your browser type, operating system, IP address and the domain name from which you accessed the Site, and if you are accessing our Site with your mobile device, the type of mobile device. In addition, we may automatically record and analyze actions taken on the Site including, but not limited to, date and times of use, clicks, page views, the amount of time you spend on each page, and search queries. Fandom Royale reserves the right to match your IP address (or any other information) with other information about you in any way permitted by applicable law. Fandom Royale will store this information on its equipment or the equipment of third parties that Fandom Royale has a relationship with for that purpose. If you create a Fandom Royale account, information may be collected under your account email address.&lt;/p&gt;\r\n\r\n&lt;p&gt;If you access or use the Site on your mobile telephone or other mobile device, including tablets, we collect mobile device identifiers, including MAC Address, and IP Address. Fandom Royale may create and assign to your device an identifier that is similar to an account number. We may collect the name you have associated with your device, device type, telephone number, country, and any other information you choose to provide, such as user name, geolocation or email address.&lt;/p&gt;\r\n\r\n&lt;p&gt;If you are anUsers, Fandom Royale may request that you provide certain personal information to Fandom Royale in order to verify your account. This information includes, but is not limited to your Users Identification &amp;amp; Password Formation will be used for internal purposes only, subject to any request by law enforcement or a court order.&lt;/p&gt;\r\n\r\n&lt;h4&gt;2. Limitation of Use or Disclosure of Personal Data&lt;/h4&gt;\r\n\r\n&lt;p&gt;When a Player closes an account, the Player will no longer have access to any of the data which we provided under that account name, including but not limited to, search history, search preferences, and any other data associated with the account. Fandom Royale reserves the right to keep any materials in a closed account as necessary to preserve and protect its rights as allowed by law (for example, to preserve records of a dispute) or to comply with its obligations under local law (for example, to keep an email address). A closed account does not mean that all of the data is expunged from the Fandom Royale systems,&lt;/p&gt;\r\n\r\n&lt;p&gt;Users may disable an account, however Fandom Royale must preserve business records pertaining to that account to comply with its obligations under law.&lt;/p&gt;\r\n\r\n&lt;h4&gt;3. Uses and Disclosures of Information&lt;/h4&gt;\r\n\r\n&lt;p&gt;Fandom Royale is committed to privacy of personal information provided by its customer, subscribers. Fandom Royale is committed to the security of all information associated with our customers. We have security measures in place to attempt to protect against the loss, misuse and alteration of personal information under our control. Any personal information you provide will only be used for the purpose for which you have provided it and will not be added to any third party mailing list without your consent.We will not contact you unless you signup for our newsletter.&lt;/p&gt;\r\n\r\n&lt;p&gt;Fandom Royale may also share such information with third parties (including operators of third-party websites and/or social networking sites) in order to show you targeted marketing ,advertisements and other content that has been customized for you.&lt;/p&gt;\r\n\r\n&lt;h4&gt;4. Transfer of Data to Third Parties&lt;/h4&gt;\r\n\r\n&lt;p&gt;We may use other companies, including affiliates and third parties, to perform services in connection with our operations, and to improve the Site and our other products and services. These third parties may include (but are not limited to) service providers and vendors.&lt;/p&gt;\r\n\r\n&lt;p&gt;In the course of providing these services, those companies may have access to Personal Information, and such Personal Information may be transferred to other countries. Those companies are contractually required to treat such Personal Information in accordance with this Privacy Policy. Please also be aware that we may use third-party cloud service providers that provide hosting, data storage and other services pursuant to standard terms and conditions that may be nonnegotiable these service providers have informed us or the general public that they apply security measures they consider adequate for the protection of information within their system, or they have a general reputation for applying such measures. However, we will not be liable (to the fullest extent permitted by law) for any damages that may result from the misuse of any information, including Personal Information, by these companies.&lt;/p&gt;\r\n\r\n&lt;p&gt;You may also use certain third-party sites or services that you link to from Fandom Royale Site. In such cases, all information you provide to a third party is provided to that third party and not to Fandom Royale, and is subject to the third party&amp;rsquo;s privacy policy and terms of service. Please see the section below titled Links to Third-Party Sites for more information.&lt;/p&gt;\r\n\r\n&lt;h4&gt;5. Cookies&lt;/h4&gt;\r\n\r\n&lt;p&gt;&amp;ldquo;Cookies&amp;rdquo; are small pieces of information that are stored by your browser on your computer&amp;rsquo;s hard drive. Please see our cookie policy for further information regarding Fandom Royale use of Cookies.&lt;/p&gt;\r\n\r\n&lt;h4&gt;6. Links to Third-Party Sites&lt;/h4&gt;\r\n\r\n&lt;p&gt;The Site may make available links to other websites. When you click on such links, you may leave our Site. The Site may also make available Company Pages, which may contain information provided by third-party Users. WE ARE NOT RESPONSIBLE FOR THE INFORMATION COLLECTION, USE, DISCLOSURE OR OTHER PRIVACY PRACTICES OF ANY THIRD PARTY, INCLUDING OUR AFFILIATES, THIRD-PARTY SERVICE PROVIDERS, ANY USERSS (INCLUDING ANY USERS THAT PROVIDES A COMPANY PAGE), ANY THIRD-PARTY SOCIAL MEDIA PLATFORM, ANY THIRD PARTY MAKING AVAILABLE THE DEVICES OR OPERATING SYSTEMS FOR WHICH THE SITE IS AVAILABLE, AND ANY THIRD PARTY OPERATING ANY WEBSITE TO WHICH THE SITE CONTAINS A LINK. YOU MAY HAVE RIGHTS DIRECTLY ENFORCEABLE AGAINST THESE THIRD PARTIES SO YOU SHOULD CONSIDER THEIR PRIVACY POLICIES TO LEARN MORE.&lt;/p&gt;\r\n\r\n&lt;h4&gt;7. Opting Out&lt;/h4&gt;\r\n\r\n&lt;p&gt;If you no longer want to receive promotional materials from us based upon your Personal Information, going forward, you may opt out of receiving such marketing related messages by sending an email to opt-out at &lt;strong&gt;FR.support@Hypo-iGames.com&lt;/strong&gt;. Please note that we may still send other messages to you, such as administrative messages. We will try to comply with your request as soon as reasonably practicable.&lt;/p&gt;\r\n'),
(4, 'refund', 'Refund Policy', '&lt;p&gt;At Fandom Royale we believe Your money is yours &amp;amp; you should get it immediately when you want. We are working with the best banking &amp;amp; gateway partners to payout our users at the earliest possible.&lt;/p&gt;\r\n\r\n&lt;p&gt;However, all the refunds at Fandom Royale are subject to following conditions :&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;All the refunds are processed to the same mode / financial instruments through which the deposits were made.&lt;/li&gt;\r\n	&lt;li&gt;In some cases, internal review team may take upto 24 working hours to process a withdrawal.&lt;/li&gt;\r\n	&lt;li&gt;Immediate withdrawal after deposits, without playing matches may invite transaction fee charges, as applicable.&lt;/li&gt;\r\n	&lt;li&gt;All the winnings above $10,000/- is subject to applicable TDS deduction.&lt;/li&gt;\r\n	&lt;li&gt;Fandom Royale reserves the right to modify/change these terms &amp;amp; conditions anytime without any notice.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n'),
(5, 'rules', 'Rules & Info', '&lt;h5&gt;&lt;span style=&quot;color:#c0392b&quot;&gt;*FOR BEST PERFORMANCE OF THIS SITE IT IS NOT &lt;/span&gt;RECOMMENDED&lt;span style=&quot;color:#c0392b&quot;&gt; TO USE FIREFOX AS YOUR BROWSER*&lt;/span&gt;&lt;/h5&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h5&gt;&lt;span style=&quot;color:#c0392b&quot;&gt;Residents of the following states/provinces are currently ineligible to have an account&amp;nbsp;on&amp;nbsp;&lt;strong&gt;FandomRoyale.com:&amp;nbsp;&lt;/strong&gt;Alabama, Arizona, Connecticut, Delaware, Hawaii, Idaho, Illinois, Indiana, Iowa, Louisiana, Maine, Michigan, Mississippi, Missouri, Montana, Nevada, New Hampshire, New Jersey, New York, Ohio, Pennsylvania, Quebec, Tennessee, Texas, Vermont, Virginia, Washington, and anywhere outside of the USA and Canada. We are always adding new eligible states so please always check back.&lt;/span&gt;&lt;/h5&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h5&gt;Verification for Age, State of Residence, and W-9&amp;nbsp;info&lt;/h5&gt;\r\n\r\n&lt;p&gt;Before any withdrawals can be made account holder must provide image of license/ID to verify age (must be 18*),&amp;nbsp;state of residence, and street address to be used on W-9&amp;nbsp;(headshot and license/ID number can be covered if desired).&amp;nbsp;Also by law, for W-9 tax reasons it is required for us to obtain account holders SSN/EIN/SIN and full legal name/registered business name.&amp;nbsp;Providing this information is safe. We&amp;rsquo;ve taken all the necessary internal steps to ensure that your information will be encrypted and is not used for anything beyond verification, processing withdrawals, and tax information. If it&amp;#39;s suspected that false information is given&amp;nbsp;then account will be terminated. If you are not comfortable giving this information then please contact us at&amp;nbsp;&lt;strong&gt;FR.support@Hypo-iGames.com&lt;/strong&gt;&amp;nbsp;to work out alternative methods. &lt;strong&gt;*Residents of&amp;nbsp;Massachusetts must be 21 years of age.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;h5&gt;Public Contests&lt;/h5&gt;\r\n\r\n&lt;p&gt;Fandom Royale will set up public contests&amp;nbsp;for both free and with entry fee. Each contest has a set number of entries. Once a contest is FULL than contest is guaranteed to run.&amp;nbsp;If a public contest&amp;nbsp;does not fill up once draft is scheduled to begin the contest will be cancelled and the entry fee will be credited back into the users account. The user may then sign-up for a different contest or keep fees in their account for future use or may be withdrawn.&lt;/p&gt;\r\n\r\n&lt;p&gt;Contests have 3 options for draft start time: 10:00am PT/1:00pm ET, 3:00pm PT/6:00pm ET,&amp;nbsp; and 8:00pm PT/11:00pm ET.&lt;/p&gt;\r\n\r\n&lt;h5&gt;Private Leagues&lt;/h5&gt;\r\n\r\n&lt;p&gt;We have provided an option for individuals to create private leagues for a nominal fee. Commissioner must send invites to users for them to join.&amp;nbsp; If the league has an entry fee than the league must fill before start of the first draft otherwise the league will be cancelled.&amp;nbsp;&amp;nbsp;If league has no entry fee than it is only required to have a minimum of two total participants, thus it will be cancelled if commissioner is the only participant by the time the draft starts.&amp;nbsp;Fandom Royale is not responsible for the league setup, entry fee amount or prize payout amount determined by the league commissioner. Please use your best judgment before playing in a league with a commissioner you do not personally know.&lt;/p&gt;\r\n\r\n&lt;p&gt;To create a private league there is an upfront charge of $1.90 for 1-week leagues&amp;nbsp;and $3.90 for season-long leagues,&amp;nbsp;and an additional charge once league is completed of 5% of the total prize (if any).&lt;/p&gt;\r\n\r\n&lt;p&gt;Playoffs for season-long private leagues works as follows: during first round of NFL/NBA/MLB playoffs the league will only consist of the top 8 teams in points (if league only has 8&amp;nbsp;or fewer teams than all teams will continue to play), during second round of NFL/NBA/MLB playoffs the league will only consist of the top 4&amp;nbsp;teams in points (if league only has 4&amp;nbsp;or fewer&amp;nbsp;teams than all teams will continue to play),&amp;nbsp;during third round (conference championships) of NFL/NBA/MLB playoffs the league will only consist of the top 2&amp;nbsp;teams in points.&lt;/p&gt;\r\n\r\n&lt;h5&gt;Drafts&lt;/h5&gt;\r\n\r\n&lt;p&gt;Once you have joined a contest or league you will be granted access to the draft room&amp;nbsp;for your contest/league. It will include all the players available to be drafted for your contest/league and will include statistical data to use as a guide.&lt;strong&gt;&amp;nbsp;Unlike other providers, our season-long leagues have&amp;nbsp;a new draft every week, thus your previous weeks roster will be cleared and a new line-up will need to be drafted each week. The day of week and time selected for draft date when creating league will be the day and time of the draft every week for the whole season.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;The draft order will be randomly determined right before the draft is set to begin. All contests and leagues use a snake draft. Example of how a snake draft works:&amp;nbsp;&amp;nbsp;If team A drafts first in the first round they would draft last in the second round. If team C drafts last in the first round, they would draft first in the second round. This serpentine style would continue though every round until the draft is complete.&lt;/p&gt;\r\n\r\n&lt;p&gt;For public contests a 3-person contest has 8 roster spots each (thus draft is 8 rounds) and a 10-person contest has 6 roster spots each&amp;nbsp;(thus draft is 6&amp;nbsp;rounds).&lt;/p&gt;\r\n\r\n&lt;p&gt;The standard draft time allotted per pick is&amp;nbsp;30 seconds. There is no auto-draft for public contests. Private leagues have an option to activate auto draft if desired. For private leagues if an owner has auto draft toggled on then pick will be made by computer after the 30 seconds expires.&lt;/p&gt;\r\n\r\n&lt;h5&gt;Payment to Play and Payouts&lt;/h5&gt;\r\n\r\n&lt;p&gt;The only type of payment accepted to participate in Fandom Royale&amp;#39;s&amp;nbsp;contests and private leagues&amp;nbsp;is through PayPal. Use your debit or credit card to create and account if you have not done so already. Any&amp;nbsp;prize money&amp;nbsp;won will be added to your account balance by the end of the last day of given contest or league at the soonest. Once added to your balance you may deposit the money back into your PayPal account&amp;nbsp;if desired.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h5&gt;Deposits &amp;amp; Withdrawals&lt;/h5&gt;\r\n\r\n&lt;p&gt;The maximum amount allowed for a single deposit is $2,000.&amp;nbsp;The maximum total deposit amount allowed over a one month period is $5,000**. The minimum withdrawal amount is $5.00. Only money that is from a winning prize can be withdrawn.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;**Residents of&amp;nbsp;Massachusetts and Maryland to have&lt;/strong&gt; &lt;strong&gt;a maximum total monthly deposit amount of $1,000.&amp;nbsp;&lt;/strong&gt;&amp;nbsp;However, residents of&amp;nbsp;Massachusetts and Maryland may sometimes request a temporary increase in monthly deposit limit. Attempts by residents of these&amp;nbsp;states to deposit more than $1,000 total per month without permission may result in account suspension or termination.&lt;/p&gt;\r\n\r\n&lt;h5&gt;Contest &amp;amp; Private League&amp;nbsp;Cancellation Fee Refund&lt;/h5&gt;\r\n\r\n&lt;p&gt;If a public contest is cancelled due to not filling&amp;nbsp;before the draft begins the user&amp;#39;s entry fee will be deposited back into their account.&amp;nbsp; If a private league with an entry fee is cancelled due to not filling&amp;nbsp;before the first draft begins then the&amp;nbsp;entry fee of all joined users will be deposited back into their account. However, the league creation charge paid by user who created league is non-refundable.&amp;nbsp;Once an entry fee&amp;nbsp;is deposited back into user&amp;#39;s account they&amp;nbsp;can then join a different contest/league&amp;nbsp;if desired.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Any questions or concerns contact us at: &lt;strong&gt;FR.support@Hypo-iGames.com.&amp;nbsp;&amp;nbsp;&lt;/strong&gt;Thanks for your interest in Fandom Royale and enjoy the games!!!&lt;/p&gt;\r\n');
